    "Route110_TrickHousePuzzle5_Text_Wahahahaha": "WAHAHAHAHA! WAHAHAHAHA!\\nCLICKETY-CLACK!",
    "Route110_TrickHousePuzzle5_Text_WaitForNextChallenge": "YOUR NEXT CHALLENGE WE WAIT FOR.",
    "Route110_TrickHousePuzzle5_Text_Mechadoll2Intro": "CLICKETY-CLACK…\\nMECHADOLL 2 AM I!\\pMECHADOLL 1'S QUIZ DIFFICULTY LEVEL\\nIS SET TOO LOW.",
    "Route110_TrickHousePuzzle5_Text_Mechadoll2Quiz1": "MECHADOLL 2 QUIZ.\\pWhich of these POKéMON did WALLY\\nborrow from your father?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll2Quiz2": "MECHADOLL 2 QUIZ.\\pWhich of these POKéMON was chasing\\nPROF. BIRCH?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll2Quiz3": "MECHADOLL 2 QUIZ.\\pWhich of these POKéMON did TEAM AQUA\\nuse in PETALBURG FOREST?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll3Intro": "CLICKETY-CLACK…\\nMECHADOLL 3 AM I!\\pMATTERS OF MONEY ARE MY SOLE FOCUS.",
    "Route110_TrickHousePuzzle5_Text_Mechadoll3Quiz1": "MECHADOLL 3 QUIZ.\\pWhich costs more?\\nThree HARBOR MAILS or one BURN HEAL?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll3Quiz2": "MECHADOLL 3 QUIZ.\\pSell one GREAT BALL and buy\\none POTION. How much money remains?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll3Quiz3": "MECHADOLL 3 QUIZ.\\pDo one REPEL and SODA POP cost\\nmore than one SUPER POTION?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll4Intro": "CLICKETY-CLACK…\\nMECHADOLL 4 THAT IS ME!\\pMY QUIZ IS AN OBJECT OF BEAUTY.",
    "Route110_TrickHousePuzzle5_Text_Mechadoll4Quiz1": "MECHADOLL 4 QUIZ.\\pIn SEASHORE HOUSE, were there more men\\nor women?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll4Quiz2": "MECHADOLL 4 QUIZ.\\pIn LAVARIDGE TOWN, were there more\\nelderly men or elderly women?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll4Quiz3": "MECHADOLL 4 QUIZ.\\pIn the TRAINER'S SCHOOL, how many\\ngirl students were there?",
    "Route110_TrickHousePuzzle5_Text_Mechadoll5Intro": "CLICKETY-CLACK…\\nMECHADOLL 5 AM I!\\pTHE MASTER'S BEST AND PROUDEST\\nACHIEVEMENT AM I.",
    "Route110_TrickHousePuzzle5_Text_Mechadoll5Quiz1": "MECHADOLL 5 QUIZ.\\pIn SLATEPORT's POKéMON FAN CLUB,\\nhow many POKéMON were there?",
